import React from 'react';
import { Dropdown} from 'react-bootstrap';

const HistorySelector = React.memo(function HistorySelector(props) {
  const historyList = [];
  for (let i = 0; i < localStorage.length; i++){
    if (localStorage.key(i).includes('wapp-')) {
      historyList.push((localStorage.key(i)).substring('wapp_'.length))
    }
  }

  let options = historyList.map((data, index) =>
    <option 
        key={index}
        value={data}
    >
        {data} x
    </option>
  );

  return(
    <Dropdown>
      <Dropdown.Toggle variant="success" id="dropdown-basic">
        Dropdown Button
      </Dropdown.Toggle>

      <Dropdown.Menu>
        <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
        <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
        <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
      // <div className="text-right">
      //   <select id="city" onChange={props.handleSelect} defaultValue={'DEFAULT'}>
      //     <option disabled value="DEFAULT"> -- Previous Searches -- </option>
      //     {options}
      //   </select>
      // </div>
  );
});

export default HistorySelector;
